import React from 'react';
import Select from 'react-select';
import { country } from './menus/options'; // Import country from the options file

export default function CountryDropdown({ onSelectOrigin }) {
  return (
    <div className="select-container">
      <label htmlFor="origin-dropdown">Select an origin</label>
      <Select
        id="origin-dropdown"
        options={country} // Use country as options
        onChange={onSelectOrigin}
        placeholder="Select origin..."
      />
    </div>
  );
}
